export default function Card(props) {
    console.log(props);
  return (
    <footer>
        <div className='cards'>
            <div>
              <div className="badge-text"><p>SOLD OUT</p></div>
                <img src={ props.picture } alt='react logo' className='react'/>
                <p><span>⭐</span> { props.rating } ({ props.reviewCount }) • { props.country }</p>
                <p>{props.title }</p>
                <p>From ${ props.price } /person</p>
            </div>
           
        </div>
    </footer>
  );
};
